import React from 'react'
import c from './Tree.module.scss'
export const Tree = (props) => {
  return (
    <div className={c.tree}>
            <span className={c.mainButton}>Головна</span>
            <div className={c.arrow__tree}></div>
            <span>{props.title}</span>
          </div>
  )
}
